// Item.js
import React from "react";
import { useParams, useNavigate } from "react-router-dom";

const Item = ({ rockets }) => {
  const { id } = useParams();
  const navigate = useNavigate();
  const rocket = rockets.find((rocket) => rocket.id === parseInt(id));

  if (!rocket) {
    return <p>Item not found</p>;
  }

  return (
    <div className="item-page">
      <div className="item-content">
        <div className="item-image">
          <img src={rocket.image} alt={rocket.name} />
        </div>
        <div className="item-details">
          <div className="item-characteristics">
            <span className="characteristic">1 characteristic</span>
            <span className="characteristic">2 characteristic</span>
          </div>
          <h2>{rocket.name}</h2>
          <p>{rocket.about_rocket}</p>
          <div className="fields">
            <div className="field">
              <label>Countable field</label>
              <input type="text" value={rocket.count_mission} readOnly />
            </div>
            <div className="field">
              <label>Selectable Field</label>
              <select>
                <option>Select</option>
              </select>
            </div>
          </div>
          <p className="price">Price: ${rocket.price_of_launch}</p>
          <div className="buttons">
            <button onClick={() => navigate(-1)}>Go back</button>
            <button>Add to cart</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Item;
